import "./Footer.css"
import facebook from "../../Assets/facebook.svg"
import {useNavigate} from "react-router-dom";
function Footer() {
    const navigate = useNavigate();
    return(
        <footer>
            <p>Znajd≈∫ nas na facebooku!</p>
            <img src={facebook} onClick={navigate()}/>
        </footer>
    )
}

export default Footer;
